setting.single-valid-value:
best if HPPrintQuality in {best} or
		(HPPrintQuality in {highest} and HPPaperType has attribute "media-type-info/@pcl-media-type[.='0']");
* if HPPrintQuality in {*};

setting.valid-values:
high-speed-draft: (HPPaperType has attribute "print-quality-pick/reference[@name='high-speed-draft']") and
			(not HPColorMode in {application-managed}) and
			not (HPColorMode in {AdobeRGB} and HPPaperType in {hp-cd-dvd-tattoo});
best: (HPPaperType has attribute "print-quality-pick/reference[@name='best']");
highest: (HPPaperType has attribute "print-quality-pick/reference[@name='highest']");
*: (HPPaperType has attribute "print-quality-pick/reference[@name='%*%']") and
			(not HPColorMode in {application-managed});

false: not HPManualBorderlessStatus in {already};
true: HPManualBorderlessStatus in {allowed} and
		not HPSelectedPhysicalPaperSizeIsRigid in {true} or HPManualBorderlessStatus in {already};

setting.single-valid-value:
notapplicable-hidden if not Printer has attribute "product/features/feature[@name='supports-manual-borderless']";
mutable-disabled if HPSelectedPaperSizeIsBorderless in {true} or
					HPPhysicalPaperSizeHasBorderlessAnalog in {false} or
					HPInvalidPaperSize in {true} or
					HPPhysicalPaperSizeIsBanner in {true} or
					(HPSelectedPaperSizeIsBorderless in {false} and HPPhysicalPaperSizeIsManualBorderless in {false}) or
					HPSelectedPhysicalPaperSizeIsRigid in {true};
mutable-enabled otherwise;

setting.default-value:
hp-premium-plus-photo-paper if HPColorMatchingIsACM in {true} or
		(HPPhysicalPaperSize has attribute "default-media-type[.='hp-premium-plus-photo-paper']") or
		((not HPPhysicalPaperSize has attribute "default-media-type") and 
		(Printer has attribute "capabilities/media-type-pick/@default[.='hp-premium-plus-photo-paper']"));
* if (HPPhysicalPaperSize has attribute "default-media-type[.='%*%']") or
		((not HPPhysicalPaperSize has attribute "default-media-type") and 
		(Printer has attribute "capabilities/media-type-pick/@default[.='%*%']"));
plain-paper otherwise;

setting.valid-values:
true: Printer has attribute "product/features/feature[@name='supports-auto-width-sensor' and .='true']" and
		HPPhysicalPaperSize has attribute "@width-sensored[.='true']";
false: not Printer has attribute "product/features/feature[@name='supports-auto-width-sensor' and .='true']" or
		not HPPhysicalPaperSize has attribute "@width-sensored[.='true']";
